"<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0435\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0412 \u0437\u0430\u043f\u0438\u0441\u0438 \u043e \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u0438 <a href=\"person.html?idx=498\">\u0415\u0433\u043e\u0448\u0438\u043d\u043e\u0439 \u0410\u043d\u043d\u044b \u0424\u0435\u0434\u043e\u0440\u043e\u0432\u043d\u044b</a> \u0432\u043e\u0441\u043f\u0440\u0438\u0435\u043c\u043d\u0438\u043a\u043e\u043c \u0437\u0430\u043f\u0438\u0441\u0430\u043d\u0430 \u043d\u0435\u043a\u0430\u044f \u041c\u0430\u0440\u0438\u044f, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0437\u043d\u0430\u0447\u0438\u0442 \u0441\u0435\u0441\u0442\u0440\u043e\u0439 \"\u0438\u0445\", \u0442\u043e \u0435\u0441\u0442\u044c \u0440\u043e\u0434\u0438\u0442\u0435\u043b\u0435\u0439 \u0410\u043d\u043d\u044b. \u041d\u043e \u0447\u044c\u044f \u0438\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e \u0441\u0435\u0441\u0442\u0440\u0430 - \u043d\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e.\n</p>\n</div>\n</div>",
