"<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0435\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0410\u043d\u0438\u043a\u0435\u0435\u0432 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447 \u0431\u044b\u043b \u043c\u043b\u0430\u0434\u0448\u0438\u043c \u0441\u044b\u043d\u043e\u043c \u0432 \u0441\u0435\u043c\u044c\u0435 \u041d\u0438\u043a\u043e\u043b\u0430\u044f \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\u0430 \u0438 \u0410\u043d\u043d\u044b \u0418\u0432\u0430\u043d\u043e\u0432\u043d\u044b. \u041e\u043d \u0440\u043e\u0434\u0438\u043b\u0441\u044f \u0432 1953-\u043c \u0433\u043e\u0434\u0443 \u0438 \u0431\u044b\u043b \u043f\u043e\u0437\u0434\u043d\u0438\u043c \u0440\u0435\u0431\u0435\u043d\u043a\u043e\u043c. \u0422\u0430\u043a \u0435\u0433\u043e \u0440\u043e\u0434\u0438\u0442\u0435\u043b\u044f\u043c \u0431\u044b\u043b\u043e 37, \u0441\u0442\u0430\u0440\u0448\u0435\u043c\u0443 \u0431\u0440\u0430\u0442\u0443 \u0413\u0435\u043d\u043d\u0430\u0434\u0438\u044e - 17, \u0430 \u0412\u0438\u0442\u0430\u043b\u0438\u044e - 14. \u0427\u0435\u0440\u0435\u0437 \u043f\u044f\u0442\u044c \u043b\u0435\u0442 \u043e\u0442 \u043e\u0441\u043b\u043e\u0436\u043d\u0435\u043d\u0438\u0439 \u043f\u043e\u0441\u043b\u0435 \u0432\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u0440\u0430\u043d\u0435\u043d\u0438\u044f \u0443\u043c\u0438\u0440\u0430\u0435\u0442 \u043e\u0442\u0435\u0446. \u0412 \u0434\u0435\u0442\u0441\u0442\u0432\u0435 \u043b\u0435\u0442\u043e\u043c \u0447\u0430\u0441\u0442\u043e \u0445\u043e\u0434\u0438\u043b \u0432 \u043f\u043b\u0430\u0432\u0430\u043d\u0438\u0435 \u0441\u043e \u0441\u0432\u043e\u0438\u043c \u0441\u0442\u0430\u0440\u0448\u0438\u043c \u0431\u0440\u0430\u0442\u043e\u043c \u0413\u0435\u043d\u043d\u0430\u0434\u0438\u0435\u043c, \u043a\u043e\u0433\u0434\u0430 \u0442\u043e\u0442 \u0440\u0430\u0431\u043e\u0442\u0430\u043b \u043d\u0430 \u0442\u0435\u043f\u043b\u043e\u0445\u043e\u0434\u0430\u0445. \u0423\u0447\u0438\u043b\u0441\u044f \u0432 \u0413\u041f\u0422\u0423-43 \u0433. \u0411\u0430\u043b\u0430\u043a\u043e\u0432\u043e, \u0441 1972 \u043f\u043e 1974 \u0433\u0433. \u0441\u043b\u0443\u0436\u0438\u043b \u0432 \u0440\u044f\u0434\u0430\u0445 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0410\u0440\u043c\u0438\u0438. \u0414\u043e \u0430\u0440\u043c\u0438\u0438 \u0432 \u043c\u0430\u0440\u0442\u0435 1972 \u0433\u043e\u0434\u0430 \u043f\u043e\u0437\u043d\u0430\u043a\u043e\u043c\u0438\u043b\u0441\u044f \u0441\u043e \u0441\u0432\u043e\u0435\u0439 \u0431\u0443\u0434\u0443\u0449\u0435\u0439 \u0436\u0435\u043d\u043e\u0439 \u0415\u0432\u0433\u0435\u043d\u0438\u0435\u0439 \u0414\u0435\u043b\u0430\u0448\u0438\u043d\u0441\u043a\u043e\u0439. \u0412\u0435\u0440\u043d\u0443\u0432\u0448\u0438\u0441\u044c \u0438\u0437 \u0430\u0440\u043c\u0438\u0438 25 \u0434\u0435\u043a\u0430\u0431\u0440\u044f 1974 \u0433\u043e\u0434\u0430, \u0440\u043e\u0432\u043d\u043e \u0447\u0435\u0440\u0435\u0437 \u043c\u0435\u0441\u044f\u0446 \u043e\u043d\u0438 \u0443\u0436\u0435 \u0441\u044b\u0433\u0440\u0430\u043b\u0438 \u0441\u0432\u0430\u0434\u044c\u0431\u0443. 14 \u044f\u043d\u0432\u0430\u0440\u044f 1976 \u0443 \u043d\u0438\u0445 \u0440\u043e\u0434\u0438\u043b\u0441\u044f \u0441\u044b\u043d \u0418\u0433\u043e\u0440\u044c. \u0420\u0430\u0431\u043e\u0442\u0430\u043b \u043d\u0430 \u0425\u0438\u043c\u0432\u043e\u043b\u043e\u043a\u043d\u043e \u0438 \u0421\u0430\u0440\u0430\u0442\u043e\u0432\u0433\u044d\u0441\u0441\u0442\u0440\u043e\u0435, \u0433\u0434\u0435 \u043e\u043d \u0438 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u0443 \u0434\u043b\u044f \u0441\u0435\u043c\u044c\u0438. \u041e\u0434\u043d\u0430\u043a\u043e \u0438\u0445 \u0431\u0440\u0430\u043a \u043f\u0440\u043e\u0434\u043b\u0438\u043b\u0441\u044f \u043d\u0435\u0434\u043e\u043b\u0433\u043e - \u0432\u0441\u0435\u0433\u043e 3.5 \u0433\u043e\u0434\u0430. \u041f\u043e \u0432\u043e\u0441\u043f\u043e\u043c\u0438\u043d\u0430\u043d\u0438\u044f\u043c \u0415\u0432\u0433\u0435\u043d\u0438\u0438: \"... \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f \u0443 \u043d\u0430\u0441 \u043f\u043e\u0441\u043b\u0435 \u0440\u0430\u0437\u0432\u043e\u0434\u0430 \u0441\u043d\u0430\u0447\u0430\u043b\u0430 \u0431\u044b\u043b\u0438 \u043d\u0435\u043c\u043d\u043e\u0433\u043e \u043d\u0430\u043f\u0440\u044f\u0436\u0435\u043d\u043d\u044b\u0435, \u0430 \u043f\u043e\u0442\u043e\u043c \u043c\u044b \u0447\u0430\u0441\u0442\u043e \u0432\u0438\u0434\u0435\u043b\u0438\u0441\u044c \u0438 \u0434\u0435\u043b\u0438\u0442\u044c \u043d\u0430\u043c \u0431\u044b\u043b\u043e \u043d\u0435\u0447\u0435\u0433\u043e\". \u041f\u043e\u0441\u043b\u0435 \u044d\u0442\u043e\u0433\u043e \u0440\u0430\u0437\u0440\u044b\u0432\u0430 \u0443 \u043d\u0435\u0433\u043e \u043d\u0435 \u0431\u044b\u043b\u043e \u0441\u0435\u043c\u044c\u0438, \u043e\u043d \u0432\u0441\u0435 \u0447\u0430\u0449\u0435 \u043f\u0440\u0438\u0431\u0435\u0433\u0430\u043b \u043a \u0443\u043f\u043e\u0442\u0440\u0435\u0431\u043b\u0435\u043d\u0438\u044e \u0441\u043f\u0438\u0440\u0442\u043d\u043e\u0433\u043e, \u0447\u0442\u043e \u0432 \u0438\u0442\u043e\u0433\u0435 \u0435\u0433\u043e \u0438 \u043f\u043e\u0433\u0443\u0431\u0438\u043b\u043e: 13 \u0438\u044e\u043d\u044f 2002 \u0433\u043e\u0434\u0430 \u0432 \u043f\u044c\u044f\u043d\u043e\u0439 \u043f\u043e\u0442\u0430\u0441\u043e\u0432\u043a\u0435 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447 \u0431\u044b\u043b \u0437\u0430\u0440\u0435\u0437\u0430\u043d \u0441\u043e\u0431\u0443\u0442\u044b\u043b\u044c\u043d\u0438\u043a\u043e\u043c.\n</p>\n</div>\n</div>",
