"<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0435\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0412 \u044e\u043d\u043e\u0448\u0435\u0441\u0442\u0432\u0435 \u0437\u0438\u043c\u043e\u0439 \u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0430\u043b\u0430\u0441\u044c \u0432 <a href=\"place.html?pdx=165\">\u041a\u0443\u043b\u0438\u043a\u043e\u0432\u043a\u0443</a> \u0438\u0437 <a href=\"place.html?pdx=49\">\u0412\u043e\u043b\u044c\u0441\u043a\u0430</a> \u043f\u0435\u0448\u043a\u043e\u043c \u0432 \u043b\u0435\u0433\u043a\u043e\u0439 \u043e\u0434\u0435\u0436\u0434\u0435 (\u0432 \u043a\u043e\u043b\u0433\u043e\u0442\u043a\u0430\u0445), \u0438\u0437-\u0437\u0430 \u0447\u0435\u0433\u043e \u0441\u0438\u043b\u044c\u043d\u043e \u043f\u0440\u043e\u0441\u0442\u0443\u0434\u0438\u043b\u0430\u0441\u044c \u0441 \u043e\u0441\u043b\u043e\u0436\u043d\u0435\u043d\u0438\u044f\u043c\u0438 \u043d\u0430 \u0441\u0435\u0440\u0434\u0446\u0435. \u0412 \u0442\u0435\u0447\u0435\u043d\u0438\u0438 \u0432\u0441\u0435\u0439 \u043e\u0441\u0442\u0432\u0448\u0435\u0439\u0441\u044f \u0436\u0438\u0437\u043d\u0438 \u0431\u043e\u043b\u044c\u043d\u043e\u0435 \u0441\u0435\u0440\u0434\u0446\u0435 \u0434\u0430\u0432\u0430\u043b\u043e \u043e \u0441\u0435\u0431\u0435 \u0437\u043d\u0430\u0442\u044c. <br />\n\u0421 \u0413\u0435\u043d\u043d\u0430\u0434\u0438\u0435\u043c \u043f\u043e\u0437\u043d\u0430\u043a\u043e\u043c\u0438\u043b \u0440\u043e\u0434\u043d\u043e\u0439 \u0431\u0440\u0430\u0442 \u041c\u0430\u0440\u0438\u0438 - <a href=\"person.html?idx=509\">\u0412\u0430\u0441\u0438\u043b\u0438\u0439 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447</a>. \u0412 \u0442\u043e \u0432\u0440\u0435\u043c\u044f \u043e\u043d \u0436\u0438\u043b \u0438 \u0440\u0430\u0431\u043e\u0442\u0430\u043b \u0437\u0443\u0431\u043d\u044b\u043c \u0442\u0435\u0445\u043d\u0438\u043a\u043e\u043c \u0432 <a href=\"place.html?pdx=170\">\u0441. \u0428\u0438\u0440\u043e\u043a\u0438\u0439 \u0411\u0443\u0435\u0440\u0430\u043a</a>.<br />\n\u0412\u043e\u043f\u0440\u0435\u043a\u0438 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0439 \u043f\u0440\u0438\u0447\u0438\u043d\u0435 \u0441\u043c\u0435\u0440\u0442\u0438 (\u043f\u0440\u043e\u0431\u043b\u0435\u043c\u044b \u0441 \u0441\u0435\u0440\u0434\u0446\u0435\u043c), \u0438\u0441\u0442\u0438\u043d\u043d\u043e\u0439 \u0441\u0442\u0430\u043b \u0446\u0435\u0440\u0440\u043e\u0437 \u043f\u0435\u0447\u0435\u043d\u0438. \u0412 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0435 \u0434\u043d\u0438 \u0441\u0432\u043e\u0435\u0439 \u0436\u0438\u0437\u043d\u0438 \u041c\u0430\u0440\u0438\u044f \u0418\u0432\u0430\u043d\u043e\u0432\u043d\u0430 \u043f\u043e\u0436\u0435\u043b\u0442\u0435\u043b\u0430, \u043f\u043e\u0445\u0443\u0434\u0435\u043b\u0430 \u0434\u043e 30-40 \u043a\u0433\n</p>\n</div>\n</div>",
