"<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0435\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u041e\u0441\u0438\u043f \u0415\u0433\u043e\u0440\u043e\u0432\u0438\u0447 \u0412\u044f\u0442\u043a\u0438\u043d, \u0436\u0438\u0442\u0435\u043b\u044c \u043f\u043e\u0447. \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0441\u043a\u0438\u0439, \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043f\u043e\u0440\u0443\u0447\u0438\u0442\u0435\u043b\u0435\u043c \u043d\u0430 \u0441\u0432\u0430\u0434\u044c\u0431\u0435 \u0443 \u0422\u0438\u043c\u043e\u0444\u0435\u044f \u041b\u0435\u043e\u043d\u0442\u044c\u0435\u0432\u0438\u0447\u0430 \u0428\u0435\u0441\u0442\u0430\u043a\u043e\u0432\u0430. \u041c\u0430\u0442\u044c \u0422\u0438\u043c\u043e\u0444\u0435\u044f \u041b\u0435\u043e\u043d\u0442\u044c\u0435\u0432\u0438\u0447\u0430 \u0437\u043e\u0432\u0443\u0442 \u041c\u0430\u0442\u0440\u043e\u043d\u0430 \u0415\u0433\u043e\u0440\u043e\u0432\u043d\u0430 \u0412\u044f\u0442\u043a\u0438\u043d\u0430, \u0442\u0430\u043a\u0436\u0435 \u0436\u0438\u0442\u0435\u043b\u044c\u043d\u0438\u0446\u0430 \u043f\u043e\u0447. \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0441\u043a\u0438\u0439. \u0418\u0441\u0445\u043e\u0434\u044f \u0438\u0437 \u044d\u0442\u0438\u0445 \u0444\u0430\u043a\u0442\u043e\u0432, \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442\u0441\u044f, \u0447\u0442\u043e \u041e\u0441\u0438\u043f \u0415\u0433\u043e\u0440\u043e\u0432\u0438\u0447 - \u0440\u043e\u0434\u043d\u043e\u0439 \u0431\u0440\u0430\u0442 \u041c\u0430\u0442\u0440\u043e\u043d\u044b \u0415\u0433\u043e\u0440\u043e\u0432\u043d\u044b \u0438 \u0440\u043e\u0434\u043d\u043e\u0439 \u0434\u044f\u0434\u044f \u0422\u0438\u043c\u043e\u0444\u0435\u044f \u041b\u0435\u043e\u043d\u0442\u044c\u0435\u0432\u0438\u0447\u0430.\n</p>\n</div>\n</div>",
