"<div>\n<i class=\"NoteType\">\n\u0411\u0438\u043e\u0433\u0440\u0430\u0444\u0438\u044f\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0411\u044b\u043b \u044f\u0440\u044b\u043c \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u043e\u043c<br />\n\u0412 \u043a\u043e\u043d\u0446\u0435 30-\u0445 \u0433\u043e\u0434\u043e\u0432 \u043f\u0435\u0440\u0435\u0435\u0437\u0436\u0430\u043b\u0438 \u0432 \u041a\u0430\u0440\u0435\u043b\u0438\u044e, \u043d\u043e \u0432\u0435\u0440\u043d\u0443\u043b\u0438\u0441\u044c \u043e\u0431\u0440\u0430\u0442\u043d\u043e \u0441 \u043d\u0430\u0447\u0430\u043b\u043e\u043c \u0432\u043e\u0439\u043d\u044b. \u0415\u0433\u043e \u0431\u0440\u0430\u0442 \u041f\u0430\u0432\u0435\u043b \u043d\u0430 \u0444\u0440\u043e\u043d\u0442 \u0431\u044b\u043b \u043f\u0440\u0438\u0437\u0432\u0430\u043d \u042f\u0441\u043a\u0438\u043d\u0441\u043a\u0438\u043c \u0420\u0412\u041a. \u042f\u0441\u043a\u0438 - \u043f\u043e\u0441\u0435\u043b\u043e\u043a \u0432 \u041a\u0430\u0440\u0435\u043b\u043e-\u0424\u0438\u043d\u0441\u043a\u043e\u0439 \u0410\u0421\u0421\u0420 (\u0441 1948 \u0433. - \u041b\u0435\u0441\u043e\u0433\u043e\u0440\u0441\u043a\u0438\u0439)<br />\n\u0420\u0430\u0431\u043e\u0442\u0430\u043b \u043d\u0430\u0447\u0430\u043b\u044c\u043d\u0438\u043a\u043e\u043c \u043f\u043e\u0436\u0430\u0440\u043d\u043e\u0439 \u043e\u0445\u0440\u0430\u043d\u044b (\u043c\u0435\u0441\u0442\u043e?)<br />\n\u041d\u0430\u0447\u0430\u043b\u044c\u043d\u0438\u043a\u043e\u043c \u0440\u0430\u0434\u0438\u043e\u0442\u043e\u0447\u043a\u0438 (\u043c\u0435\u0441\u0442\u043e?)<br />\n\u041f\u0435\u0440\u0435\u0432\u0451\u0437 \u0441\u0435\u043c\u044c\u044e \u0432 \u043f. \u0411\u043b\u044e\u0434\u0446\u044b \u041d\u043e\u0432\u043e\u0441\u0438\u0431\u0438\u0440\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438, \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u043b\u0438 \u043f\u043e\u0441\u0442 \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u044f (\u043d\u0435 \u043f\u043e\u0434\u0442\u0432\u0435\u0440\u0434\u0438\u043b\u043e\u0441\u044c)<br />\n\u0418\u0437 \u0411\u043b\u044e\u0434\u0446\u0435\u0432 \u0441 \u041a\u0441\u0435\u043d\u0438\u0435\u0439 \u0422\u0438\u043c\u043e\u0444\u0435\u0435\u0432\u043d\u043e\u0439 \u043f\u0435\u0440\u0435\u0435\u0445\u0430\u043b\u0438 \u0432 \u043f. \u042f\u0439\u0432\u0430 \u041f\u0435\u0440\u043c\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438, \u0433\u0434\u0435 \u0432\u044b\u043b\u043e\u0436\u0438\u043b \u043f\u0430\u0440\u0442\u0431\u0438\u043b\u0435\u0442 \u0438 \u0432\u044b\u0448\u0435\u043b \u0438\u0437 \u043f\u0430\u0440\u0442\u0438\u0438. \u0420\u0430\u0431\u043e\u0442\u0430\u043b \u0438\u0437\u0432\u043e\u0437\u0447\u0438\u043a\u043e\u043c \u0432\u043e\u0434\u044b \u0438 \u0445\u043b\u0435\u0431\u0430 \u043d\u0430 \u043a\u043e\u0431\u044b\u043b\u0435\n</p>\n</div>\n</div>",
