"<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0435\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u041f\u043e \u0432\u043e\u0441\u043f\u043e\u043c\u0438\u043d\u0430\u043d\u0438\u044f\u043c \u0410\u043d\u0442\u043e\u043d\u0438\u043d\u044b \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u043d\u044b, \u043e\u0442\u0431\u044b\u0432\u0430\u043b\u0430 \u043d\u0430\u043a\u0430\u0437\u0430\u043d\u0438\u0435 \u0437\u0430 \u0441\u0432\u043e\u0435\u0433\u043e \u043e\u0442\u0446\u0430, \u0440\u0435\u043f\u0440\u0435\u0441\u0441\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0433\u043e \u0432 1932-\u043c \u0433\u043e\u0434\u0443, \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u043f\u043e\u043b\u0443\u0433\u043e\u0434\u0430. \u041f\u043e\u0441\u043b\u0435 \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0435\u043d\u0438\u044f \u0441 \u043f\u043e\u0434\u0440\u0443\u0436\u043a\u043e\u0439 \u0431\u0435\u0436\u0430\u043b\u0438 \u043d\u043e\u0447\u044c\u044e \u0438 \u043b\u0435\u0441\u0430\u043c\u0438, \u0431\u043e\u044f\u0441\u044c \u043f\u0440\u0435\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u044f<br />\n\u0420\u0430\u0431\u043e\u0442\u0430\u043b\u0430 \u0443 \u043c\u0443\u0436\u0430 \u0410\u043d\u0430\u0442\u043e\u043b\u0438\u044f \u0422\u0438\u043c\u043e\u0444\u0435\u0435\u0432\u0438\u0447\u0430 \u0442\u0435\u0445\u043d\u0438\u0447\u043a\u043e\u0439 \u043d\u0430 \u0440\u0430\u0434\u0438\u043e\u0442\u043e\u0447\u043a\u0435\n</p>\n</div>\n</div>",
