"<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0435\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0421\u043e\u0441\u0442\u043e\u044f\u043b\u0430 \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u0435\u043c \u0432 \u0441\u0443\u0434\u0435\n</p>\n</div>\n<i class=\"NoteType\">\n\u041e\u0431\u0449\u0435\u0435\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0411\u044b\u043b\u043e 6 \u0434\u0435\u0442\u0435\u0439, \u0411\u044b\u043b\u0430 \u0433\u0440\u0430\u043c\u043e\u0442\u043d\u043e\u0439, \u0411\u044b\u043b\u0430 \u0433\u043e\u0440\u044f\u0447\u043e \u043b\u044e\u0431\u0438\u043c\u0430 \u0412\u0430\u0441\u0438\u043b\u0438\u0435\u043c \u041d\u0438\u043a\u0438\u0444\u043e\u0440\u043e\u0432\u0438\u0447\u0435\u043c, \u0411\u044b\u043b\u0430 \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u0435\u043c \u0432 \u0441\u0443\u0434\u0435\n</p>\n</div>\n</div>",
