"<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0435\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0420\u043e\u0434\u0438\u043b\u0430\u0441\u044c 21 \u0430\u0432\u0433\u0443\u0441\u0442\u0430. \u041c\u0435\u0441\u0442\u043e \u043f\u0440\u043e\u0436\u0438\u0432\u0430\u043d\u0438\u044f - \u0433. \u0421\u043e\u043b\u0438\u043a\u0430\u043c\u0441\u043a (\u041f\u0435\u0440\u043c\u0441\u043a\u0438\u0439 \u043a\u0440\u0430\u0439), \u0420\u043e\u0441\u0441\u0438\u044f.<br />\n70 \u0448\u043a\u043e\u043b\u0430 1957\u20141961<br />\n27 \u0448\u043a\u043e\u043b\u0430 1961\u20141967<br />\n\u041f\u041d\u0418\u041f\u0423, \u041f\u0435\u0440\u043c\u0441\u043a\u0438\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439 \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 (\u0431\u044b\u0432\u0448. \u041f\u0413\u0418, \u041f\u041f\u0418, \u041f\u0413\u0422\u0423) 1967\u20141972\n</p>\n</div>\n</div>",
