"<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0435\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0421\u043e \u0441\u043b\u043e\u0432 \u041b\u044e\u0431\u043e\u0432\u0438 \u041f\u043e\u0442\u0435\u0440\u044f\u0445\u0438\u043d\u043e\u0439, \u0431\u044b\u043b \u043e\u0447\u0435\u043d\u044c \u043b\u044e\u0431\u043e\u0437\u043d\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u043c \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u043e\u043c \u0438 \u0432\u0441\u0451 \u0432\u0440\u0435\u043c\u044f \u0441\u043f\u0440\u0430\u0448\u0438\u0432\u0430\u043b \u043a\u0442\u043e \u0438 \u043a\u0443\u0434\u0430 \u0438\u0434\u0451\u0442.\n</p>\n</div>\n</div>",
