"<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0435\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0412 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0435 3 \u043c\u0435\u0441\u044f\u0446\u0430 \u0436\u0438\u0437\u043d\u0438 \u043b\u0438\u0448\u0438\u043b\u0430\u0441\u044c \u0440\u0430\u0441\u0441\u0443\u0434\u043a\u0430. \u0411\u044b\u043b\u0430 \u043d\u0430 \u043f\u043e\u043f\u0435\u0447\u0435\u043d\u0438\u0438 \u0443 \u0441\u0435\u043c\u044c\u0438 \u0441\u044b\u043d\u0430 - \u042e\u0440\u0437\u0430\u043d\u043e\u0432\u0430 \u0410\u043d\u0430\u0442\u043e\u043b\u0438\u044f \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\u0430. \u0416\u0438\u043b\u0430 \u0432 \u0438\u0445 \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u0435 \u043f\u043e\u0434 \u043f\u0440\u0438\u0441\u043c\u043e\u0442\u0440\u043e\u043c \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u044b \u0424\u0435\u0434\u043e\u0440\u043e\u0432\u043d\u044b. \u0414\u0435\u043c\u0435\u043d\u0446\u0438\u044f \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u043b\u0430 \u0442\u044f\u0436\u0435\u043b\u0443\u044e \u0444\u043e\u0440\u043c\u0443, \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0440\u0430\u0437 \u0440\u0430\u043d\u043d\u0435\u0439 \u0432\u0435\u0441\u043d\u043e\u0439 \u0434\u0430\u0436\u0435 \u0443\u0431\u0435\u0433\u0430\u043b\u0430 \u0438\u0437 \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u044b, \u0447\u0442\u043e\u0431\u044b \u0432\u0435\u0440\u043d\u0443\u0442\u044c\u0441\u044f \u0434\u043e\u043c\u043e\u0439 \u0432 \u041a\u0443\u043b\u0438\u043a\u043e\u0432\u043a\u0443, \u0445\u043e\u0442\u044f \u0434\u0430\u0436\u0435 \u043f\u043e\u043d\u044f\u0442\u0438\u044f \u043d\u0435 \u0438\u043c\u0435\u043b\u0430, \u043a\u0443\u0434\u0430 \u0438\u0434\u0442\u0438.\n</p>\n</div>\n</div>",
